import React from 'react'
import styles from '../../styles/AdminNav.module.css'

const AdminNav = () => {
  return (
    <div className={styles.nav_container}>
        <div className={styles.nav_item}>
            <p className={styles.nav_item_text}>Dashboard</p>

        </div>

    </div>
  )
}

export default AdminNav
